    u'\u0412\u0430\u0440\u0438\u0430\u043d\u0442 \u043e\u0432\u0442\u0435\u0442\u0430 \u043d\u0430 \u0432\u043e\u043f\u0440\u043e\u0441 "\u043d\u0430\u0448\u043b\u043e\u0441\u044c \u043b\u0438 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u0432 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u0435"',
